PREFIX prod: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?service ?serviceLabel ?person ?personLabel WHERE {
  ?service a prod:Service .
  ?service prod:price ?price .
  ?service prod:hasProductManager ?person .
  OPTIONAL { ?service rdfs:label ?serviceLabel }
  OPTIONAL { ?person rdfs:label ?personLabel }
}
ORDER BY DESC(?price)
LIMIT 1

