PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX prod-vocab: <http://ld.company.org/prod-vocab/>

SELECT DISTINCT ?coil ?label ?weight ?depth ?height ?width ((?weight / (?depth * ?height * ?width)) AS ?density) WHERE {
  BIND(<http://ld.company.org/prod-instances/hw-N832-1055352> AS ?coil)
  OPTIONAL { ?coil rdfs:label ?label }
  ?coil prod-vocab:weight_g ?weight .
  ?coil prod-vocab:depth_mm ?depth .
  ?coil prod-vocab:height_mm ?height .
  ?coil prod-vocab:width_mm ?width .
} LIMIT 1

PREFIX vocab: <http://ld.company.org/prod-vocab/>

SELECT DISTINCT ?employee ?name ?email ?phone WHERE {
  ?employee a vocab:Employee .
  ?employee vocab:name ?name .
  OPTIONAL { ?employee vocab:email ?email . }
  OPTIONAL { ?employee vocab:phone ?phone . }

  FILTER NOT EXISTS {
    ?otherEmployee vocab:hasManager ?employee .
  }
}
ORDER BY ?name

