PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?service ?serviceLabel WHERE {
  ?service rdf:type/rdfs:subClassOf* <http://ld.company.org/prod-vocab/Service> .
