} LIMIT 5

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?category ?categoryLabel ?minWeightHardware ?minWeightHardwareLabel ?maxWeightHardware ?maxWeightHardwareLabel ?minWeight ?maxWeight WHERE {
  {
    SELECT DISTINCT ?category (MIN(?weight) AS ?minWeight) (MAX(?weight) AS ?maxWeight) WHERE {
      ?hardware rdf:type/rdfs:subClassOf* <http://ld.company.org/prod-vocab/Hardware> .
      ?hardware <http://ld.company.org/prod-vocab/hasCategory> ?category .
      ?hardware <http://ld.company.org/prod-vocab/weight_g> ?weight .
    } GROUP BY ?category
  }
  ?minWeightHardware rdf:type/rdfs:subClassOf* <http://ld.company.org/prod-vocab/Hardware> ;
                    <http://ld.company.org/prod-vocab/hasCategory> ?category ;
                    <http://ld.company.org/prod-vocab/weight_g> ?minWeight .
  ?maxWeightHardware rdf:type/rdfs:subClassOf* <http://ld.company.org/prod-vocab/Hardware> ;
                    <http://ld.company.org/prod-vocab/hasCategory> ?category ;
                    <http://ld.company.org/prod-vocab/weight_g> ?maxWeight .
  OPTIONAL { ?category rdfs:label ?categoryLabel }
  OPTIONAL { ?minWeightHardware rdfs:label ?minWeightHardwareLabel }
  OPTIONAL { ?maxWeightHardware rdfs:label ?maxWeightHardwareLabel }
}

