  ?productB <http://ld.company.org/prod-vocab/compatibleProduct> ?productA .
  FILTER(?productA < ?productB)
  OPTIONAL { ?productA rdfs:label ?productALabel }
  OPTIONAL { ?productB rdfs:label ?productBLabel }
}

